import { Component } from 'react';
import axios from 'axios';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    tempListings = [ "listing1", "listing2"];

    componentDidMount()
    {
        axios({
            method: 'get',
            url: 'https://localhost:44332/listing',
            data: {}
        }).then((response) => {
            var strs = response.data;
            var arrobjs = strs.map(str => JSON.parse(str));
            const listings = arrobjs.map(arrobj => ({ ...arrobj }));
            this.setState(listings);
            console.log(this.state.listings);
        })
        
    }

    render()
    {
        console.log('mashallah', this.state.listings);
        return (

            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
